


-- 第三方库-工程建管开始
CREATE DATABASE IF NOT EXISTS eng_supervision;
USE eng_supervision;

/* ========== 1) 工程资产维表 ========== */
DROP TABLE IF EXISTS dim_asset;
CREATE TABLE dim_asset (
                           asset_id     BIGINT        COMMENT '资产ID（唯一标识）',
                           dt           DATE          COMMENT '快照日期',
                           asset_code   VARCHAR(100)  COMMENT '资产编码',
                           asset_name   VARCHAR(200)  COMMENT '资产名称',
                           asset_type   VARCHAR(50)   COMMENT '资产类型：RESERVOIR/LEVEE/PUMP_STATION/SLUICE等',
                           project_id   BIGINT        COMMENT '所属项目ID',
                           org_id       BIGINT        COMMENT '运维单位ID',
                           river_name   VARCHAR(128)  COMMENT '河流/渠道名称',
                           admin_region VARCHAR(64)   COMMENT '行政区划（代码或名称）',
                           longitude    DOUBLE        COMMENT '经度',
                           latitude     DOUBLE        COMMENT '纬度',
                           design_level VARCHAR(64)   COMMENT '设计标准：防洪标准/保证率等',
                           build_year   INT           COMMENT '建成年份',
                           status       TINYINT       COMMENT '状态：1启用/0停用/2在建/3停运',
                           ext_json     STRING        COMMENT '扩展信息（JSON文本）',
                           update_time  DATETIME      COMMENT '记录更新时间'
)
    ENGINE=OLAP
UNIQUE KEY(asset_id, dt)
COMMENT '工程资产维表'
DISTRIBUTED BY HASH(asset_id) BUCKETS 16
PROPERTIES ("replication_num"="1","storage_format"="V2");

/* ========== 2) 项目维表 ========== */
DROP TABLE IF EXISTS dim_project;
CREATE TABLE dim_project (
                             project_id   BIGINT        COMMENT '项目ID',
                             dt           DATE          COMMENT '快照日期',
                             project_code VARCHAR(100)  COMMENT '项目编码',
                             project_name VARCHAR(200)  COMMENT '项目名称',
                             owner_org_id BIGINT        COMMENT '业主单位ID',
                             start_date   DATE          COMMENT '开工日期',
                             end_date     DATE          COMMENT '完工/验收日期',
                             status       TINYINT       COMMENT '状态：1在建/2完工/0停缓建',
                             ext_json     STRING        COMMENT '扩展信息（JSON）',
                             update_time  DATETIME      COMMENT '记录更新时间'
)
    ENGINE=OLAP
UNIQUE KEY(project_id, dt)
COMMENT '项目维表'
DISTRIBUTED BY HASH(project_id) BUCKETS 8
PROPERTIES ("replication_num"="1","storage_format"="V2");

/* ========== 3) 组织维表 ========== */
DROP TABLE IF EXISTS dim_org;
CREATE TABLE dim_org (
                         org_id        BIGINT        COMMENT '组织ID',
                         dt            DATE          COMMENT '快照日期',
                         org_code      VARCHAR(100)  COMMENT '组织编码',
                         org_name      VARCHAR(200)  COMMENT '组织名称',
                         org_type      VARCHAR(50)   COMMENT '类型：OWNER/OPERATOR/CONTRACTOR等',
                         admin_region  VARCHAR(64)   COMMENT '行政区划',
                         contact_name  VARCHAR(100)  COMMENT '联系人',
                         contact_phone VARCHAR(50)   COMMENT '联系电话',
                         status        TINYINT       COMMENT '状态：1启用/0停用',
                         update_time   DATETIME      COMMENT '记录更新时间'
)
    ENGINE=OLAP
UNIQUE KEY(org_id, dt)
COMMENT '组织维表'
DISTRIBUTED BY HASH(org_id) BUCKETS 4
PROPERTIES ("replication_num"="1","storage_format"="V2");

/* ========== 4) 运行日志实施表 ========== */
DROP TABLE IF EXISTS fact_operation_log;
CREATE TABLE fact_operation_log (
                                    dt         DATE          COMMENT '分区日期',
                                    asset_id   BIGINT        COMMENT '资产ID',
                                    op_id      BIGINT        COMMENT '运行事件ID',
                                    asset_code VARCHAR(100)  COMMENT '资产编码',
                                    project_id BIGINT        COMMENT '项目ID',
                                    org_id     BIGINT        COMMENT '运维单位ID',
                                    op_type    VARCHAR(50)   COMMENT '事件类型',
                                    op_content STRING        COMMENT '事件内容',
                                    operator   VARCHAR(100)  COMMENT '操作人',
                                    event_time DATETIME      COMMENT '事件时间',
                                    ts         DATETIME      COMMENT '写入时间'
)
    ENGINE=OLAP
DUPLICATE KEY(dt, asset_id, op_id)
COMMENT '运行日志实施表'
DISTRIBUTED BY HASH(asset_id) BUCKETS 16
PROPERTIES ("replication_num"="1","storage_format"="V2");

/* ========== 5) 巡检实施表 ========== */
DROP TABLE IF EXISTS fact_inspection;
CREATE TABLE fact_inspection (
                                 dt          DATE          COMMENT '分区日期',
                                 asset_id    BIGINT        COMMENT '资产ID',
                                 insp_id     BIGINT        COMMENT '巡检ID',
                                 asset_code  VARCHAR(100)  COMMENT '资产编码',
                                 insp_type   VARCHAR(50)   COMMENT '巡检类型',
                                 issue_level TINYINT       COMMENT '问题等级',
                                 issue_desc  STRING        COMMENT '问题描述',
                                 insp_user   VARCHAR(100)  COMMENT '巡检人/算法',
                                 insp_time   DATETIME      COMMENT '巡检时间',
                                 geo_long    DOUBLE        COMMENT '经度',
                                 geo_lat     DOUBLE        COMMENT '纬度',
                                 media_urls  STRING        COMMENT '照片/视频URL',
                                 ts          DATETIME      COMMENT '写入时间'
)
    ENGINE=OLAP
DUPLICATE KEY(dt, asset_id, insp_id)
COMMENT '巡检实施表'
DISTRIBUTED BY HASH(asset_id) BUCKETS 16
PROPERTIES ("replication_num"="1","storage_format"="V2");

/* ========== 6) 养护/维修实施表 ========== */
DROP TABLE IF EXISTS fact_maintenance;
CREATE TABLE fact_maintenance (
                                  dt             DATE          COMMENT '分区日期',
                                  asset_id       BIGINT        COMMENT '资产ID',
                                  work_id        BIGINT        COMMENT '作业单ID',
                                  asset_code     VARCHAR(100)  COMMENT '资产编码',
                                  work_type      VARCHAR(50)   COMMENT '作业类型',
                                  work_desc      STRING        COMMENT '作业内容',
                                  plan_start     DATETIME      COMMENT '计划开始',
                                  plan_end       DATETIME      COMMENT '计划结束',
                                  actual_start   DATETIME      COMMENT '实际开始',
                                  actual_end     DATETIME      COMMENT '实际结束',
                                  cost_amount    DECIMAL(18,2) COMMENT '费用（元）',
                                  contractor_org VARCHAR(200)  COMMENT '承包单位',
                                  status         TINYINT       COMMENT '状态',
                                  ts             DATETIME      COMMENT '写入时间'
)
    ENGINE=OLAP
DUPLICATE KEY(dt, asset_id, work_id)
COMMENT '养护/维修实施表'
DISTRIBUTED BY HASH(asset_id) BUCKETS 8
PROPERTIES ("replication_num"="1","storage_format"="V2");

/* ========== 7) 告警事件实施表 ========== */
DROP TABLE IF EXISTS fact_alarm_event;
CREATE TABLE fact_alarm_event (
                                  alarm_id   BIGINT        COMMENT '告警ID',
                                  asset_id   BIGINT        COMMENT '资产ID',
                                  asset_code VARCHAR(100)  COMMENT '资产编码',
                                  alarm_type VARCHAR(50)   COMMENT '告警类别',
                                  level      TINYINT       COMMENT '等级：1一般/2较重/3严重/4特别严重',
                                  title      VARCHAR(200)  COMMENT '告警标题',
                                  detail     STRING        COMMENT '告警详情',
                                  source     VARCHAR(50)   COMMENT '来源',
                                  raise_time DATETIME      COMMENT '触发时间',
                                  clear_time DATETIME      COMMENT '清除时间',
                                  state      TINYINT       COMMENT '状态：0未处理/1处理中/2已解除/3忽略',
                                  handler    VARCHAR(100)  COMMENT '处理人',
                                  ts         DATETIME      COMMENT '写入时间',
                                  dt         DATE          COMMENT '分区日期'
)
    ENGINE=OLAP
UNIQUE KEY(alarm_id)
COMMENT '告警事件实施表'
DISTRIBUTED BY HASH(alarm_id) BUCKETS 16
PROPERTIES ("replication_num"="1","storage_format"="V2");

/* ========== 8) 在线监测/遥测实施表 ========== */
DROP TABLE IF EXISTS fact_telemetry;
CREATE TABLE fact_telemetry (
                                dt         DATE          COMMENT '分区日期',
                                asset_id   BIGINT        COMMENT '资产ID',
                                metric     VARCHAR(64)   COMMENT '指标',
                                event_time DATETIME      COMMENT '采集时间',
                                row_id     BIGINT        COMMENT '行ID',
                                asset_code VARCHAR(100)  COMMENT '资产编码',
                                value      DOUBLE        COMMENT '值',
                                unit       VARCHAR(32)   COMMENT '单位',
                                quality    TINYINT       COMMENT '质量：0正常/1估算/2缺测/3异常',
                                ts         DATETIME      COMMENT '写入时间'
)
    ENGINE=OLAP
DUPLICATE KEY(dt, asset_id, metric, event_time, row_id)
COMMENT '在线监测/遥测事实表'
DISTRIBUTED BY HASH(asset_id) BUCKETS 32
PROPERTIES (
  "replication_num" = "1",
  "storage_format"  = "V2"
);


USE eng_supervision;



































-- 第三方库-工程建管结束


-- 应用库开始
CREATE DATABASE IF NOT EXISTS ads;
USE ads;

-- 6.1 水位日统计报表
CREATE TABLE IF NOT EXISTS ads_water_level_daily_report (
                                                            stat_date          DATE           COMMENT '统计日期',
                                                            station_code       VARCHAR(64)    COMMENT '站点编码',
    station_name       VARCHAR(128)   COMMENT '站点名称',
    avg_level          DECIMAL(10,3)  COMMENT '日均',
    max_level          DECIMAL(10,3)  COMMENT '日最大',
    max_time           DATETIME       COMMENT '最大值出现时间',
    min_level          DECIMAL(10,3)  COMMENT '日最小',
    min_time           DATETIME       COMMENT '最小值出现时间',
    data_completeness  DECIMAL(5,2)   COMMENT '当日采样完整率（%）',
    warning_cnt        INT            COMMENT '当日预警次数',
    etl_time           DATETIME       COMMENT '入仓时间'
    )
    ENGINE=OLAP
    DUPLICATE KEY(stat_date, station_code)
    COMMENT '水位日统计报表'
    DISTRIBUTED BY HASH(station_code) BUCKETS 10
    PROPERTIES (
                   "replication_num" = "1",
                   "storage_format"  = "V2"
               );

-- 6.2 小时均值实时看板
CREATE TABLE IF NOT EXISTS ads_water_level_hourly_realtime (
    station_code   VARCHAR(64)    COMMENT '站点编码',
    hour_window    DATETIME       COMMENT '小时窗口起点',
    avg_level      DECIMAL(10,3)  COMMENT '小时均值',
    updated_at     DATETIME       COMMENT '最近刷新时间'
    )
    ENGINE=OLAP
    UNIQUE KEY(station_code, hour_window)
    COMMENT '小时均值实时看板'
    DISTRIBUTED BY HASH(station_code) BUCKETS 10
    PROPERTIES (
                   "replication_num" = "1",
                   "storage_format"  = "V2"
               );

-- 6.3 预警事件看板
CREATE TABLE IF NOT EXISTS ads_water_level_warning_board (
                                                             event_id         BIGINT        COMMENT '事件ID',
                                                             station_code     VARCHAR(64)   COMMENT '站点编码',
    warning_level    TINYINT       COMMENT '3红/2黄/1蓝',
    start_time       DATETIME      COMMENT '事件开始时间',
    end_time         DATETIME      COMMENT '事件结束时间（可空）',
    duration_minutes INT           COMMENT '持续分钟数',
    current_level    DECIMAL(10,3) COMMENT '当前水位',
    status           VARCHAR(32)   COMMENT 'active/cleared',
    etl_time         DATETIME      COMMENT '入仓时间'
    )
    ENGINE=OLAP
    UNIQUE KEY(event_id)
    COMMENT '预警事件看板'
    DISTRIBUTED BY HASH(event_id) BUCKETS 10
    PROPERTIES (
                   "replication_num" = "1",
                   "storage_format"  = "V2"
               );

-- 创建 ADS 层表：站点水位预警月报表
CREATE TABLE IF NOT EXISTS ads_station_water_level_month_report (
                                                                    station_id       BIGINT          COMMENT '测站ID',
                                                                    station_name     STRING          COMMENT '测站名称',
                                                                    avg_water_level  STRING   COMMENT '月平均水位',
    warning_level    STRING          COMMENT '预警等级',
    stat_month       STRING          COMMENT '统计时间（YYYY-MM）'
    )
    ENGINE=OLAP
    COMMENT "站点水位预警月报表"
    PROPERTIES (
    "replication_num" = "1"
               );

CREATE TABLE IF NOT EXISTS ads_basin_water_month_report_wide_update (
                                                                        basin_code   VARCHAR         COMMENT '流域编码（可空）',
                                                                        stat_month   STRING         COMMENT '统计月份（YYYY-MM）',
                                                                        station_cnt  BIGINT         COMMENT '参与测站数',
                                                                        avg_level    STRING  COMMENT '月平均水位',
                                                                        max_level    STRING  COMMENT '月最大水位',
                                                                        min_level    STRING  COMMENT '月最小水位'
)
    ENGINE=OLAP
    COMMENT "流域水位月报表（更新写）"
    PROPERTIES (
    "replication_num" = "1"
               );

CREATE TABLE IF NOT EXISTS ads_basin_water_month_report_wide_full (
                                                                        basin_code   VARCHAR         COMMENT '流域编码（可空）',
                                                                        stat_month   STRING         COMMENT '统计月份（YYYY-MM）',
                                                                        station_cnt  BIGINT         COMMENT '参与测站数',
                                                                        avg_level    STRING  COMMENT '月平均水位',
                                                                        max_level    STRING  COMMENT '月最大水位',
                                                                        min_level    STRING  COMMENT '月最小水位'
)
    ENGINE=OLAP
    COMMENT "流域水位月报表（全量写）"
    PROPERTIES (
    "replication_num" = "1"
               );

CREATE TABLE IF NOT EXISTS ads_basin_water_month_report_wide_append (
                                                                      basin_code   VARCHAR         COMMENT '流域编码（可空）',
                                                                      stat_month   STRING         COMMENT '统计月份（YYYY-MM）',
                                                                      station_cnt  BIGINT         COMMENT '参与测站数',
                                                                      avg_level    STRING  COMMENT '月平均水位',
                                                                      max_level    STRING  COMMENT '月最大水位',
                                                                      min_level    STRING  COMMENT '月最小水位'
)
    ENGINE=OLAP
    COMMENT "流域水位月报表（追加写）"
    PROPERTIES (
    "replication_num" = "1"
               );

-- 应用库结束

-- 主题层开始
CREATE DATABASE IF NOT EXISTS dws;
USE dws;


-- 5.1 dws_water_level_hourly_agg — 小时级聚合
CREATE TABLE IF NOT EXISTS dws_water_level_hourly_agg (
                                                          station_id     BIGINT               COMMENT '维表ID',
                                                          station_code   STRING               COMMENT '站点编码',
                                                          hour_window    DATETIME             COMMENT '小时窗口起点',
                                                          avg_level      DECIMAL(10,3)        COMMENT '均值',
    min_level      DECIMAL(10,3)        COMMENT '最小值',
    max_level      DECIMAL(10,3)        COMMENT '最大值',
    cnt            BIGINT               COMMENT '样本数',
    compute_mode   STRING               COMMENT 'batch/stream',
    etl_time       DATETIME             COMMENT '入仓时间'
    )
    ENGINE=OLAP
    COMMENT '水位小时级聚合'
    PROPERTIES (
                   "replication_num" = "1",
                   "storage_format" = "V2"
               );

-- 5.2 dws_water_level_daily_agg — 日级聚合
CREATE TABLE IF NOT EXISTS dws_water_level_daily_agg (
                                                         stat_date      DATE                 COMMENT '统计日期',
                                                         station_id     BIGINT               COMMENT '维表ID',
                                                         station_code   STRING               COMMENT '站点编码',
                                                         avg_level      DECIMAL(10,3)        COMMENT '日均',
    p95_level      DECIMAL(10,3)        COMMENT 'P95',
    max_level      DECIMAL(10,3)        COMMENT '日最大',
    min_level      DECIMAL(10,3)        COMMENT '日最小',
    first_obs_time DATETIME             COMMENT '当日首条时间',
    last_obs_time  DATETIME             COMMENT '当日末条时间',
    etl_time       DATETIME             COMMENT '入仓时间'
    )
    ENGINE=OLAP
    COMMENT '水位日级聚合'
    PROPERTIES (
                   "replication_num" = "1",
                   "storage_format" = "V2"
               );

-- 5.3 dws_water_level_warning_lvl — 水位预警分级
CREATE TABLE IF NOT EXISTS dws_water_level_warning_lvl (
                                                           station_id       BIGINT               COMMENT '维表ID',
                                                           station_code     STRING               COMMENT '站点编码',
                                                           obs_time         DATETIME             COMMENT '观测时间',
                                                           water_level      DECIMAL(10,3)        COMMENT '水位（米）',
    warning_level    TINYINT              COMMENT '3红/2黄/1蓝/0无',
    threshold_blue   DECIMAL(10,3)        COMMENT '蓝阈值',
    threshold_yellow DECIMAL(10,3)        COMMENT '黄阈值',
    threshold_red    DECIMAL(10,3)        COMMENT '红阈值',
    etl_time         DATETIME             COMMENT '入仓时间'
    )
    ENGINE=OLAP
    COMMENT '水位预警分级'
    PROPERTIES (
                   "replication_num" = "1",
                   "storage_format" = "V2"
               );



CREATE TABLE dws_station_water_day_report (
                                              station_id     BIGINT        COMMENT '测站ID',
                                              station_name   STRING        COMMENT '测站名称',
                                              avg_level_year DECIMAL(10,3) COMMENT '年平均水位(米)',
                                              stat_date      DATE          COMMENT '统计日期'
)

    COMMENT '站点水位日报表'
PROPERTIES (
  "replication_num" = "1"
);


-- 主题层结束

-- 明细层开始
CREATE DATABASE IF NOT EXISTS dwd;
USE dwd;

-- 4.1 dwd_dim_station — 统一站点维表
CREATE TABLE IF NOT EXISTS dwd_dim_station (
                                               station_id          BIGINT                  COMMENT '站点维ID（中台分配）',
                                               station_code        STRING                  COMMENT '站点编码（业务键）',
                                               station_name        STRING                  COMMENT '站点名称',
                                               basin_code          STRING                  COMMENT '流域编码',
                                               basin_name          STRING                  COMMENT '流域名称（字典映射）',
                                               river_name          STRING                  COMMENT '河流名称',
                                               longitude           DECIMAL(10,6)           COMMENT '经度',
    latitude            DECIMAL(10,6)           COMMENT '纬度',
    admin_region_code   STRING                  COMMENT '行政区划码',
    status              TINYINT                 COMMENT '1启用/0停用',
    effective_from      DATETIME                COMMENT '生效起',
    effective_to        DATETIME                COMMENT '生效止',
    etl_time            DATETIME                COMMENT '入仓时间'
    )
    ENGINE=OLAP
    COMMENT '统一站点维表'
    PROPERTIES (
                   "replication_num" = "1",
                   "storage_format" = "V2"
               );

-- 4.2 dwd_fact_water_level_clean — 清洗后的水位明细
CREATE TABLE IF NOT EXISTS dwd_fact_water_level_clean (
                                                          station_id       BIGINT               COMMENT '维表ID（可空后补）',
                                                          station_code     STRING               COMMENT '站点编码',
                                                          obs_time         DATETIME             COMMENT '观测时间',
                                                          water_level      DECIMAL(10,3)        COMMENT '水位（米，清洗后值）',
    anomaly_flag     TINYINT              COMMENT '异常标记：0正常/1异常',
    impute_flag      TINYINT              COMMENT '缺失补全标记：1补值',
    quality_flag_std STRING               COMMENT '统一质控码',
    src_system       STRING               COMMENT '来源系统',
    etl_time         DATETIME             COMMENT '入仓时间'
    )
    ENGINE=OLAP
    COMMENT '清洗后的水位明细'
    PROPERTIES (
                   "replication_num" = "1",
                   "storage_format" = "V2"
               );

-- 4.3 dwd_fact_water_level_dedup — 去重后的水位明细
CREATE TABLE IF NOT EXISTS dwd_fact_water_level_dedup (
                                                          station_id     BIGINT               COMMENT '维表ID',
                                                          station_code   STRING               COMMENT '站点编码',
                                                          obs_time       DATETIME             COMMENT '观测时间',
                                                          water_level    DECIMAL(10,3)        COMMENT '水位（米）',
    select_rule    STRING               COMMENT '选择规则（latest_ts/best_quality）',
    etl_time       DATETIME             COMMENT '入仓时间'
    )
    ENGINE=OLAP
    COMMENT '去重后的水位明细'
    PROPERTIES (
                   "replication_num" = "1",
                   "storage_format" = "V2"
               );

-- 4.4 dwd_fact_water_level_split — 字段拆分后的水位明细
CREATE TABLE IF NOT EXISTS dwd_fact_water_level_split (
                                                          station_id          BIGINT               COMMENT '维表ID',
                                                          station_code        STRING               COMMENT '站点编码',
                                                          obs_time            DATETIME             COMMENT '观测时间',
                                                          water_level         DECIMAL(10,3)        COMMENT '水位（米）',
    basin_code          STRING               COMMENT '流域编码（拆分/映射）',
    admin_region_code   STRING               COMMENT '行政区划（拆分/映射）',
    etl_time            DATETIME             COMMENT '入仓时间'
    )
    ENGINE=OLAP
    COMMENT '字段拆分后的水位明细'
    PROPERTIES (
                   "replication_num" = "1",
                   "storage_format" = "V2"
               );

-- 4.5 dwd_fact_water_level_unpivot — 行列转置中间层
CREATE TABLE IF NOT EXISTS dwd_fact_water_level_unpivot (
                                                            rid            BIGINT               COMMENT '技术主键（为满足首列非 STRING 要求）',
                                                            station_code   STRING               COMMENT '站点编码',
                                                            obs_time       DATETIME             COMMENT '观测时间',
                                                            metric_name    STRING               COMMENT '指标名',
                                                            metric_value   DECIMAL(18,6)        COMMENT '指标值',
    etl_time       DATETIME             COMMENT '入仓时间'
    )
    ENGINE=OLAP
    COMMENT '行列转置中间层（可选）'
    PROPERTIES (
                   "replication_num" = "1",
                   "storage_format" = "V2"
               );

CREATE TABLE IF NOT EXISTS dwd_station_water_month_report_wide (
                                                                   station_id    BIGINT   COMMENT '测站ID',
                                                                   station_name  STRING   COMMENT '测站名称',
                                                                   `2025_01`     STRING   COMMENT '2025-01 月平均水位',
                                                                   `2025_02`     STRING   COMMENT '2025-02 月平均水位',
                                                                   `2025_03`     STRING   COMMENT '2025-03 月平均水位',
                                                                   `2025_04`     STRING   COMMENT '2025-04 月平均水位',
                                                                   `2025_05`     STRING   COMMENT '2025-05 月平均水位',
