-- 原始层结束
-- 1) ODS_WR_STATION — 水文监测站点基础信息（1000条）
SELECT
    number AS station_id,
    CONCAT('ST', LPAD(number, 4, '0')) AS station_code,
    CONCAT('站点', number) AS station_name,
    CONCAT('B', MOD(number, 6) + 1) AS basin_code,
    CONCAT('河流', MOD(number, 12) + 1) AS river_name,
    100 + RAND() * 30,     -- 经度 100~130
    20 + RAND() * 20,      -- 纬度  20~40
    CONCAT('CN', LPAD(MOD(number, 9999), 4, '0')) AS admin_region_code,
    IF(MOD(number, 5) = 0, 0, 1) AS status,   -- 少量停用
    NOW(),
    NOW()
FROM numbers("number" = 1000);

-- 2) ODS_WR_WATER_LEVEL — 水位原始明细（1000条）
SELECT
    number AS id,
    CONCAT('ST', LPAD(MOD(number, 1000) + 1, 4, '0')) AS station_code,
    NOW() - INTERVAL (1000 - number) MINUTE AS obs_time,
    8 + RAND() * 6,   -- 水位 8.000 ~ 14.999
    IF(RAND() > 0.97, 'BAD', 'OK') AS quality_flag,
    NOW()
FROM numbers("number" = 1000);

-- 3) ODS_HYD_WATER_LEVEL — 水位时序（1000条）
SELECT
    number AS id,
    CONCAT('ST', LPAD(MOD(number, 1000) + 1, 4, '0')) AS station_code,
    MOD(number, 50) + 1 AS sensor_id,  -- 50个传感器轮换
    NOW() - INTERVAL (1000 - number) MINUTE AS obs_time,
    CURDATE() AS obs_date,
    7 + RAND() * 5,    -- 水位 7.000 ~ 11.999
    IF(RAND() > 0.985, 'BAD', 'OK') AS quality_code,
    'AUTO_GEN' AS source,
    UUID() AS trace_id,
    CONCAT('{"seq":', number, ',"note":"wl"}') AS ext_json,
    NOW()
FROM numbers("number" = 1000);

-- 4) ODS_HYD_DISCHARGE — 流量时序（1000条）
SELECT
    number AS id,
    CONCAT('ST', LPAD(MOD(number, 1000) + 1, 4, '0')) AS station_code,
    MOD(number, 50) + 1 AS sensor_id,  -- 50个传感器轮换
    NOW() - INTERVAL (1000 - number) MINUTE AS obs_time,
    CURDATE() AS obs_date,
    80 + RAND() * 120,  -- 流量 80.000 ~ 199.999 m^3/s
    IF(RAND() > 0.985, 'BAD', 'OK') AS quality_code,
    'AUTO_GEN' AS source,
    UUID() AS trace_id,
    CONCAT('{"seq":', number, ',"note":"q"}') AS ext_json,
    NOW()
FROM numbers("number" = 1000);
